import React from "react";

const Info = ({ points, rebounds, assists, avgFG, avgThree, avgFree }) => {
  return (
    <div className="info">
      <ul>
        <li>{points}</li>
        <li>{rebounds}</li>
        <li>{assists}</li>
        <li>{avgFG}%</li>
        <li>{avgThree}%</li>
        <li>{avgFree}%</li>
      </ul>
    </div>
  );
};

export default Info;
